import React from 'react';
import { NavLink } from 'react-router-dom';
import './Sidebar.css';

const Sidebar = ({ onLogout }) => {
    return (
        <div className="sidebar">
            <div className="sidebar-header">
                <h2>Admin Panel</h2>
            </div>
            <ul className="sidebar-menu">
                <li><NavLink to="/dashboard" activeClassName="active">Dashboard</NavLink></li>
                <li><NavLink to="/billboards" activeClassName="active">Billboards</NavLink></li>
                <li><NavLink to="/orders" activeClassName="active">Orders</NavLink></li>
                <li><NavLink to="/reservations" activeClassName="active">Reservations</NavLink></li>
                <li><NavLink to="/users" activeClassName="active">Users</NavLink></li>
            </ul>
            <div className="sidebar-footer">
                <button className="logout-button" onClick={onLogout}>Logout</button>
            </div>
        </div>
    );
};

export default Sidebar;
